import "./App.css";
import Search from "./Search";
import "bootstrap/dist/css/bootstrap.min.css";

export default function App() {
  return (
    <div className="App">
      <h1>Weather App</h1>
      <Search />
      <a href="https://github.com/hannabiloi/react-app-shecodes-week-4">
        Open-source code on GitHub
      </a>
    </div>
  );
}
